interviewer_comment:
"The candidate has good English and soft skills and is almost ready for the interview. There are some tips to pay attention to:

1)should be ready for the small talk (about the weather etc), be positive and make sure to ask the ‘How are you?’ question back; 
2)should remember the structure of self-presentation and follow it; 
3)should think about the situations (the biggest challenge, the biggest success and a negative situation) using the STAR plan in the chat(S- situation, T-task, A- activity, R-result);
4)do not forget to use closing phrases such as ‘That’s it/ That’s all I wanted to say / I am ready to answer your other questions’ etc. 
5)should write down the questions to the customer using polite phrases from the chat. 
6)should be better prepared to talk about why you are the fit for this position (the example of the answer is in the chat);
7)should practise answering different unexpected and tricky questions as he didn’t always undertand the meaning of the question;
8)should pay attention to the pronounciation of the words: technology, developer, architect and to the phrase ‘make a desicion’.
In general, the candidate sounds professional.
I wish him good luck at the real interview with the customer!"

1)should ask "How are you?' question back to establish the repport;
